import {GoogleLogin} from 'react-google-login';

const clientId = ""

function Login() {
  const onSucess = (res) => {
    console.log("loginSucess", res.profileObj);
  }

  const onFailure = (res) => {
    console.log("login failed", res);
  }

  return(
    <div id="signInButton">
      <GoogleLogin
        clientId={clientId}
        buttonText="Login"
        onSuccess={onSuccess}
        onFailure={onFailure}
        cookiePolicy='single_host_origin'
        isSignedIn={true}
      />
    </div>
  )
}

export default Login;
